import React from "react";
import "./Card.scss";
import Grid from "../grid/Grid";

export default function card(props) {
    const {pet} = props;


  return (
    <div>
      <div className="card">
        <img src={pet.picture} alt={pet.name} className="card-image" />

        <div className="card-body">
          <h5 className="card-title">{pet.name}</h5>
          <h5 className="card-description">{pet.breed}</h5>
        </div>
      </div>
    </div>
  );
}
